              <tr>
                <th> ID </th>
                <th> Fullname </th>
                <th> Email </th>
              </tr>
            </thead>

            <tbody>
              {Object.keys(content).map((data, i) => {
                <tr key={i}>
                  <td> Key: {i} </td>
                  <td> {content[data]}</td>
                </tr>;
              })}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default App;
